INSERT INTO `posts` VALUES (1,'His mother had always taught him','His mother had always taught him not to ever think of himself as better than others. He\'d tried to live by this motto. He never looked down on those who were less fortunate or who had less money than him. But the stupidity of the group of people he was talking to made him change his mind.',9,'https://picsum.photos/id/120/500/300'),(2,'He was an expert but not in a discipline','He was an expert but not in a discipline that anyone could fully appreciate. He knew how to hold the cone just right so that the soft server ice-cream fell into it at the precise angle to form a perfect cone each and every time. It had taken years to perfect and he could now do it without even putting any thought behind it.',13,'https://picsum.photos/id/121/500/300'),(3,'Dave watched as the forest burned up on the hill.','Dave watched as the forest burned up on the hill, only a few miles from her house. The car had been hastily packed and Marta was inside trying to round up the last of the pets. Dave went through his mental list of the most important papers and documents that they couldn\'t leave behind. He scolded himself for not having prepared these better in advance and hoped that he had remembered everything that was needed. He continued to wait for Marta to appear with the pets, but she still was nowhere to be seen.',32,'https://picsum.photos/id/122/500/300'),(4,'All he wanted was a candy bar.','All he wanted was a candy bar. It didn\'t seem like a difficult request to comprehend, but the clerk remained frozen and didn\'t seem to want to honor the request. It might have had something to do with the gun pointed at his face.',12,'https://picsum.photos/id/123/500/300'),(5,'Hopes and dreams were dashed that day.','Hopes and dreams were dashed that day. It should have been expected, but it still came as a shock. The warning signs had been ignored in favor of the possibility, however remote, that it could actually happen. That possibility had grown from hope to an undeniable belief it must be destiny. That was until it wasn\'t and the hopes and dreams came crashing down.',41,'https://picsum.photos/id/124/500/300'),(6,'Dave wasn\'t exactly sure how he had ended up','Dave wasn\'t exactly sure how he had ended up in this predicament. He ran through all the events that had lead to this current situation and it still didn\'t make sense. He wanted to spend some time to try and make sense of it all, but he had higher priorities at the moment. The first was how to get out of his current situation of being naked in a tree with snow falling all around and no way for him to get down.',47,'https://picsum.photos/id/125/500/300'),(7,'This is important to remember.','This is important to remember. Love isn\'t like pie. You don\'t need to divide it among all your friends and loved ones. No matter how much love you give, you can always give more. It doesn\'t run out, so don\'t try to hold back giving it as if it may one day run out. Give it freely and as much as you want.',12,'https://picsum.photos/id/126/500/300'),(8,'One can cook on and with an open fire.','One can cook on and with an open fire. These are some of the ways to cook with fire outside. Cooking meat using a spit is a great way to evenly cook meat. In order to keep meat from burning, it\'s best to slowly rotate it.',31,'https://picsum.photos/id/127/500/300'),(9,'There are different types of secrets.','There are different types of secrets. She had held onto plenty of them during her life, but this one was different. She found herself holding onto the worst type. It was the type of secret that could gnaw away at your insides if you didn\'t tell someone about it, but it could end up getting you killed if you did.',42,'https://picsum.photos/id/128/500/300'),(10,'They rushed out the door.','They rushed out the door, grabbing anything and everything they could think of they might need. There was no time to double-check to make sure they weren\'t leaving something important behind. Everything was thrown into the car and they sped off. Thirty minutes later they were safe and that was when it dawned on them that they had forgotten the most important thing of all.',1,'https://picsum.photos/id/129/500/300'),(11,'It wasn\'t quite yet time to panic.','It wasn\'t quite yet time to panic. There was still time to salvage the situation. At least that is what she was telling himself. The reality was that it was time to panic and there wasn\'t time to salvage the situation, but he continued to delude himself into believing there was.',25,'https://picsum.photos/id/130/500/300'),(12,'She was aware that things could go wrong.','She was aware that things could go wrong. In fact, she had trained her entire life in anticipation that things would go wrong one day. She had quiet confidence as she started to see that this was the day that all her training would be worthwhile and useful. At this point, she had no idea just how wrong everything would go that day.',26,'https://picsum.photos/id/131/500/300'),(13,'She wanted rainbow hair.','She wanted rainbow hair. That\'s what she told the hairdresser. It should be deep rainbow colors, too. She wasn\'t interested in pastel rainbow hair. She wanted it deep and vibrant so there was no doubt that she had done this on purpose.',44,'https://picsum.photos/id/132/500/300'),(14,'The paper was blank.','The paper was blank. It shouldn\'t have been. There should have been writing on the paper, at least a paragraph if not more. The fact that the writing wasn\'t there was frustrating. Actually, it was even more than frustrating. It was downright distressing.',1,'https://picsum.photos/id/133/500/300'),(15,'The trees, therefore, must be such old','The trees, therefore, must be such old and primitive techniques that they thought nothing of them, deeming them so inconsequential that even savages like us would know of them and not be suspicious. At that, they probably didn\'t have too much time after they detected us orbiting and intending to land. And if that were true, there could be only one place where their civilization was hidden.',15,'https://picsum.photos/id/134/500/300'),(16,'There was only one way to do things in the Statton house.','There was only one way to do things in the Statton house. That one way was to do exactly what the father, Charlie, demanded. He made the decisions and everyone else followed without question. That was until today.',31,'https://picsum.photos/id/135/500/300'),(17,'She was in a hurry.','She was in a hurry. Not the standard hurry when you\'re in a rush to get someplace, but a frantic hurry. The type of hurry where a few seconds could mean life or death. She raced down the road ignoring speed limits and weaving between cars. She was only a few minutes away when traffic came to a dead standstill on the road ahead.',5,'https://picsum.photos/id/136/500/300'),(18,'She had a terrible habit o comparing her life to others','She had a terrible habit o comparing her life to others. She realized that their life experiences were completely different than her own and that she saw only what they wanted her to see, but that didn\'t matter. She still compared herself and yearned for what she thought they had and she didn\'t.',28,'https://picsum.photos/id/137/500/300'),(19,'The rain and wind abruptly stopped.','The rain and wind abruptly stopped, but the sky still had the gray swirls of storms in the distance. Dave knew this feeling all too well. The calm before the storm. He only had a limited amount of time before all Hell broke loose, but he stopped to admire the calmness. Maybe it would be different this time, he thought, with the knowledge deep within that it wouldn\'t.',46,'https://picsum.photos/id/138/500/300'),(20,'He couldn\'t remember exactly where he had read it','He couldn\'t remember exactly where he had read it, but he was sure that he had. The fact that she didn\'t believe him was quite frustrating as he began to search the Internet to find the article. It wasn\'t as if it was something that seemed impossible. Yet she insisted on always seeing the source whenever he stated a fact.',38,'https://picsum.photos/id/139/500/300'),(21,'He wandered down the stairs and into the basement','He wandered down the stairs and into the basement. The damp, musty smell of unuse hung in the air. A single, small window let in a glimmer of light, but this simply made the shadows in the basement deeper. He inhaled deeply and looked around at a mess that had been accumulating for over 25 years. He was positive that this was the place he wanted to live.',37,'https://picsum.photos/id/140/500/300'),(22,'She has seen this scene before.','She has seen this scene before. It had come to her in dreams many times before. She had to pinch herself to make sure it wasn\'t a dream again. As her fingers squeezed against her arm, she felt the pain. It was this pain that immediately woke her up.',30,'https://picsum.photos/id/141/500/300'),(23,'It\'s an unfortunate reality that we don\'t teach people how to make money','It\'s an unfortunate reality that we don\'t teach people how to make money (beyond getting a 9 to 5 job) as part of our education system. The truth is there are a lot of different, legitimate ways to make money. That doesn\'t mean they are easy and that you won\'t have to work hard to succeed, but it does mean that if you\'re willing to open your mind a bit you don\'t have to be stuck in an office from 9 to 5 for the next fifty years o your life.',2,'https://picsum.photos/id/142/500/300'),(24,'The robot clicked disapprovingly.','The robot clicked disapprovingly, gurgled briefly inside its cubical interior and extruded a pony glass of brownish liquid. \"Sir, you will undoubtedly end up in a drunkard\'s grave, dead of hepatic cirrhosis,\" it informed me virtuously as it returned my ID card. I glared as I pushed the glass across the table.',34,'https://picsum.photos/id/143/500/300'),(25,'It went through such rapid contortions','It went through such rapid contortions that the little bear was forced to change his hold on it so many times he became confused in the darkness, and could not, for the life of him, tell whether he held the sheep right side up, or upside down. But that point was decided for him a moment later by the animal itself, who, with a sudden twist, jabbed its horns so hard into his lowest ribs that he gave a grunt of anger and disgust.',27,'https://picsum.photos/id/144/500/300'),(26,'She patiently waited for his number to be called.','She patiently waited for his number to be called. She had no desire to be there, but her mom had insisted that she go. She\'s resisted at first, but over time she realized it was simply easier to appease her and go. Mom tended to be that way. She would keep insisting until you wore down and did what she wanted. So, here she sat, patiently waiting for her number to be called.',27,'https://picsum.photos/id/145/500/300'),(27,'Ten more steps.','If he could take ten more steps it would be over, but his legs wouldn\'t move. He tried to will them to work, but they wouldn\'t listen to his brain. Ten more steps and it would be over but it didn\'t appear he would be able to do it.',17,'https://picsum.photos/id/146/500/300'),(28,'He had three simple rules by which he lived.','He had three simple rules by which he lived. The first was to never eat blue food. There was nothing in nature that was edible that was blue. People often asked about blueberries, but everyone knows those are actually purple. He understood it was one of the stranger rules to live by, but it had served him well thus far in the 50+ years of his life.',22,'https://picsum.photos/id/147/500/300'),(29,'The chair sat in the corner where it had been','The chair sat in the corner where it had been for over 25 years. The only difference was there was someone actually sitting in it. How long had it been since someone had done that? Ten years or more he imagined. Yet there was no denying the presence in the chair now.',38,'https://picsum.photos/id/148/500/300'),(30,'Things aren\'t going well at all','Things aren\'t going well at all with mom today. She is just a limp noodle and wants to sleep all the time. I sure hope that things get better soon.',2,'https://picsum.photos/id/149/500/300'),(31,'It was just a burger.','It was just a burger. Why couldn\'t she understand that? She knew he\'d completely changed his life around her eating habits, so why couldn\'t she give him a break this one time? She wasn\'t even supposed to have found out. Yes, he had promised her and yes, he had broken that promise, but still in his mind, all it had been was just a burger.',36,'https://picsum.photos/id/150/500/300'),(32,'He swung back the fishing pole and cast the line','He swung back the fishing pole and cast the line which ell 25 feet away into the river. The lure landed in the perfect spot and he was sure he would soon get a bite. He never expected that the bite would come from behind in the form of a bear.',2,'https://picsum.photos/id/151/500/300'),(33,'He lifted the bottle to his lips and took a sip','He lifted the bottle to his lips and took a sip of the drink. He had tasted this before, but he couldn\'t quite remember the time and place it had happened. He desperately searched his mind trying to locate and remember where he had tasted this when the bicycle ran over his foot.',33,'https://picsum.photos/id/152/500/300'),(34,'Debbie had taken George for granted','Debbie had taken George for granted for more than fifteen years now. He wasn\'t sure what exactly had made him choose this time and place to address the issue, but he decided that now was the time. He looked straight into her eyes and just as she was about to speak, turned away and walked out the door.',30,'https://picsum.photos/id/153/500/300'),(35,'She sat deep in thought.','She sat deep in thought. The next word that came out o her mouth would likely be the most important word of her life. It had to be exact with no possibility of being misinterpreted. She was ready. She looked deeply into his eyes and said, \"Octopus.\"',15,'https://picsum.photos/id/154/500/300'),(36,'The leather jacked showed the scars','The leather jacked showed the scars of being his favorite for years. It wore those scars with pride, feeling that they enhanced his presence rather than diminishing it. The scars gave it character and had not overwhelmed to the point that it had become ratty. The jacket was in its prime and it knew it.',45,'https://picsum.photos/id/155/500/300'),(37,'There was no time.','There was no time. He ran out of the door without half the stuff he needed for work, but it didn\'t matter. He was late and if he didn\'t make this meeting on time, someone\'s life may be in danger.',31,'https://picsum.photos/id/156/500/300'),(38,'He collected the plastic trash on a daily basis.','He collected the plastic trash on a daily basis. It never seemed to end. Even if he cleaned the entire beach, more plastic would cover it the next day after the tide had come in. Although it was a futile effort that would never be done, he continued to pick up the trash each day.',19,'https://picsum.photos/id/157/500/300'),(39,'It was so great to hear from you today','\"It was so great to hear from you today and it was such weird timing,\" he said. \"This is going to sound funny and a little strange, but you were in a dream I had just a couple of days ago. I\'d love to get together and tell you about it if you\'re up for a cup of coffee,\" he continued, laying the trap he\'d been planning for years.',36,'https://picsum.photos/id/158/500/300'),(40,'Have you ever wondered about toes?','Why 10 toes and not 12. Why are some bigger than others? Some people can use their toes to pick up things while others can barely move them on command. Some toes are nice to look at while others are definitely not something you want to look at. Toes can be stubbed and make us scream. Toes help us balance and walk. 10 toes are just something to ponder.',20,'https://picsum.photos/id/159/500/300'),(41,'His parents continued to question him.','He didn\'t know what to say to them since they refused to believe the truth. He explained again and again, and they dismissed his explanation as a figment of his imagination. There was no way that grandpa, who had been dead for five years, could have told him where the treasure had been hidden. Of course, it didn\'t help that grandpa was roaring with laughter in the chair next to him as he tried to explain once again how he\'d found it.',13,'https://picsum.photos/id/160/500/300'),(42,'You know that tingly feeling you get on the back of your neck sometimes?','You know that tingly feeling you get on the back of your neck sometimes? I just got that feeling when talking with her. You know I don\'t believe in sixth senses, but there is something not right with her. I don\'t know how I know, but I just do.',7,'https://picsum.photos/id/161/500/300'),(43,'Explain to me again why I shouldn\'t cheat?','\"Explain to me again why I shouldn\'t cheat?\" he asked. \"All the others do and nobody ever gets punished for doing so. I should go about being happy losing to cheaters because I know that I don\'t? That\'s what you\'re telling me?\"',36,'https://picsum.photos/id/162/500/300'),(44,'A long black shadow slid across the pavement','A long black shadow slid across the pavement near their feet and the five Venusians, very much startled, looked overhead. They were barely in time to see the huge gray form of the carnivore before it vanished behind a sign atop a nearby building which bore the mystifying information \"Pepsi-Cola.\"',5,'https://picsum.photos/id/163/500/300'),(45,'The red line moved across the page.','The red line moved across the page. With each millimeter it advanced forward, something changed in the room. The actual change taking place was difficult to perceive, but the change was real. The red line continued relentlessly across the page and the room would never be the same.',12,'https://picsum.photos/id/164/500/300'),(46,'The clowns had taken over. And yes, they were literally clowns.','The clowns had taken over. And yes, they were literally clowns. Over 100 had appeared out of a small VW bug that had been driven up to the bank. Now they were all inside and had taken it over.',43,'https://picsum.photos/id/165/500/300'),(47,'The shoes had been there for as long as anyone could remember.','The shoes had been there for as long as anyone could remember. In fact, it was difficult for anyone to come up with a date they had first appeared. It had seemed they\'d always been there and yet they seemed so out of place. Why nobody had removed them was a question that had been asked time and again, but while they all thought it, nobody had ever found the energy to actually do it.',11,'https://picsum.photos/id/166/500/300'),(48,'Trees. It was something about the trees.','Trees. It was something about the trees. The way they swayed with the wind in unison. The way they shaded the area around them. The sounds of their leaves in the wind and the creaks from the branches as they sway, The trees were making a statement that I just couldn\'t understand.',18,'https://picsum.photos/id/167/500/300'),(49,'Sometimes it\'s just better not to be seen.','Sometimes it\'s just better not to be seen. That\'s how Harry had always lived his life. He prided himself as being the fly on the wall and the fae that blended into the crowd. That\'s why he was so shocked that she noticed him.',14,'https://picsum.photos/id/168/500/300'),(50,'It was a concerning development that he couldn\'t get out of his mind.','He\'d had many friends throughout his early years and had fond memories of playing with them, but he couldn\'t understand how it had all stopped. There was some point as he grew up that he played with each of his friends for the very last time, and he had no idea that it would be the last.',48,'https://picsum.photos/id/169/500/300'),(51,'The towels had been hanging from the rod for years.','The towels had been hanging from the rod for years. They were stained and worn, and quite frankly, just plain ugly. Debra didn\'t want to touch them but she really didn\'t have a choice. It was important for her to see what was living within them.',47,'https://picsum.photos/id/170/500/300'),(52,'The headache wouldn\'t go away.','The headache wouldn\'t go away. She\'s taken medicine but even that didn\'t help. The monstrous throbbing in her head continued. She had this happen to her only once before in her life and she realized that only one thing could be happening.',9,'https://picsum.photos/id/171/500/300'),(53,'The young man wanted a role model.','The young man wanted a role model. He looked long and hard in his youth, but that role model never materialized. His only choice was to embrace all the people in his life he didn\'t want to be like.',46,'https://picsum.photos/id/172/500/300'),(54,'Debbie knew she was being selfish','Debbie knew she was being selfish and unreasonable. She understood why the others in the room were angry and frustrated with her and the way she was acting. In her eyes, it didn\'t really matter how they felt because she simply didn\'t care.',30,'https://picsum.photos/id/173/500/300'),(55,'She tried to explain that love wasn\'t like pie.','She tried to explain that love wasn\'t like pie. There wasn\'t a set number of slices to be given out. There wasn\'t less to be given to one person if you wanted to give more to another. That after a set amount was given out it would all disappear. She tried to explain this, but it fell on deaf ears.',50,'https://picsum.photos/id/174/500/300'),(56,'The house was located at the top of the hill','The house was located at the top of the hill at the end of a winding road. It wasn\'t obvious that the house was there, but everyone in town knew that it existed. They were just all too afraid to ever go and see it in person.',28,'https://picsum.photos/id/175/500/300'),(57,'It seemed like it should have been so simple.','It seemed like it should have been so simple. There was nothing inherently difficult with getting the project done. It was simple and straightforward enough that even a child should have been able to complete it on time, but that wasn\'t the case. The deadline had arrived and the project remained unfinished.',25,'https://picsum.photos/id/176/500/300'),(58,'Balloons are pretty and come in different colors','Balloons are pretty and come in different colors, different shapes, different sizes, and they can even adjust sizes as needed. But don\'t make them too big or they might just pop, and then bye-bye balloon. It\'ll be gone and lost for the rest of mankind. They can serve a variety of purposes, from decorating to water balloon wars. You just have to use your head to think a little bit about what to do with them.',3,'https://picsum.photos/id/177/500/300'),(59,'She looked at her student wondering if she could ever get through.','She looked at her student wondering if she could ever get through. \"You need to learn to think for yourself,\" she wanted to tell him. \"Your friends are holding you back and bringing you down.\" But she didn\'t because she knew his friends were all that he had and even if that meant a life of misery, he would never give them up.',29,'https://picsum.photos/id/178/500/300'),(60,'He heard the crack echo in the late afternoon about a mile away.','He heard the crack echo in the late afternoon about a mile away. His heart started racing and he bolted into a full sprint. \"It wasn\'t a gunshot, it wasn\'t a gunshot,\" he repeated under his breathlessness as he continued to sprint.',33,'https://picsum.photos/id/179/500/300'),(61,'I\'m going to hire professional help tomorrow.','I\'m going to hire professional help tomorrow. I can\'t handle this anymore. She fell over the coffee table and now there is blood in her catheter. This is much more than I ever signed up to do.',21,'https://picsum.photos/id/180/500/300'),(62,'He watched as the young man tried','He watched as the young man tried to impress everyone in the room with his intelligence. There was no doubt that he was smart. The fact that he was more intelligent than anyone else in the room could have been easily deduced, but nobody was really paying any attention due to the fact that it was also obvious that the young man only cared about his intelligence.',4,'https://picsum.photos/id/181/500/300'),(63,'Many people say that life isn\'t like a bed of roses.','Many people say that life isn\'t like a bed of roses. I beg to differ. I think that life is quite like a bed of roses. Just like life, a bed of roses looks pretty on the outside, but when you\'re in it, you find that it is nothing but thorns and pain. I myself have been pricked quite badly.',9,'https://picsum.photos/id/182/500/300'),(64,'There are only three ways to make this work.','There are only three ways to make this work. The first is to let me take care of everything. The second is for you to take care of everything. The third is to split everything 50 / 50. I think the last option is the most preferable, but I\'m certain it\'ll also mean the end of our marriage.',34,'https://picsum.photos/id/183/500/300'),(65,'Time is all relative based on age and experience.','As a middle-aged adult, time flies by as you watch your children grow up. And finally, as you get old and you have fewer responsibilities and fewer demands on you, time slows. You appreciate each day and are thankful you are alive. An hour is the same amount of time for everyone yet it can feel so different in how it goes by.',46,'https://picsum.photos/id/184/500/300'),(66,'Time is all relative based on age and experience.','When you are a child an hour is a long time to wait but a very short time when that’s all the time you are allowed on your iPad. As a teenager time goes faster the more deadlines you have and the more you procrastinate. As a young adult, you think you have forever to live and don’t appreciate the time you spend with others.',42,'https://picsum.photos/id/185/500/300'),(67,'Welcome to my world.','You will be greeted by the unexpected here and your mind will be challenged and expanded in ways that you never thought possible. That is if you are able to survive...',33,'https://picsum.photos/id/186/500/300'),(68,'She sat down with her notebook in her hand','She sat down with her notebook in her hand, her mind wandering to faraway places. She paused and considered all that had happened. It hadn\'t gone as expected. When the day began she thought it was going to be a bad one, but as she sat recalling the day\'s events to write them down, she had to admit, it had been a rather marvelous day.',33,'https://picsum.photos/id/187/500/300'),(69,'The wave roared towards them with speed and violence they had not anticipated.','The wave roared towards them with speed and violence they had not anticipated. They both turned to run but by that time it was too late. The wave crashed into their legs sweeping both of them off of their feet. They now found themselves in a washing machine of saltwater, getting tumbled and not know what was up or down.',42,'https://picsum.photos/id/188/500/300'),(70,'Sometimes there isn\'t a good answer.','Sometimes there isn\'t a good answer. No matter how you try to rationalize the outcome, it doesn\'t make sense. And instead of an answer, you are simply left with a question. Why?',38,'https://picsum.photos/id/189/500/300'),(71,'He knew what he was supposed to do.','He knew what he was supposed to do. That had been apparent from the beginning. That was what made the choice so difficult. What he was supposed to do and what he would do were not the same. This would have been fine if he were willing to face the inevitable consequences, but he wasn\'t.',34,'https://picsum.photos/id/190/500/300'),(72,'The words hadn\'t flowed from his fingers','The words hadn\'t flowed from his fingers for the past few weeks. He never imagined he\'d find himself with writer\'s block, but here he sat with a blank screen in front of him.',44,'https://picsum.photos/id/191/500/300'),(73,'It was difficult to explain to them','It was difficult to explain to them how the diagnosis of certain death had actually given him life. While everyone around him was in tears and upset, he actually felt more at ease. The doctor said it would be less than a year. That gave him a year to live, something he\'d failed to do with his daily drudgery of a routine that had passed as life until then.',21,'https://picsum.photos/id/192/500/300'),(74,'He couldn\'t move. His head throbbed and spun.','He couldn\'t move. His head throbbed and spun. He couldn\'t decide if it was the flu or the drinking last night. It was probably a combination of both.',30,'https://picsum.photos/id/193/500/300'),(75,'There was something beautiful in his hate.','There was something beautiful in his hate. It wasn\'t the hate itself as it was a disgusting display of racism and intolerance. It was what propelled the hate and the fact that although he had this hate, he didn\'t understand where it came from. It was at that moment that she realized that there was hope in changing him.',5,'https://picsum.photos/id/194/500/300'),(76,'Her mom had warned her.','Her mom had warned her. She had been warned time and again, but she had refused to believe her. She had done everything right and she knew she would be rewarded for doing so with the promotion.',15,'https://picsum.photos/id/195/500/300'),(77,'She nervously peered over the edge.','She nervously peered over the edge. She understood in her mind that the view was supposed to be beautiful, but all she felt was fear. There had always been something about heights that disturbed her, and now she could feel the full force of this unease.',37,'https://picsum.photos/id/196/500/300'),(78,'The thing that\'s great about this job','The thing that\'s great about this job is the time sourcing the items involves no traveling. I just look online to buy it. It\'s really as simple as that. While everyone else is searching for what they can sell, I sit in front of my computer and buy better stuff for less money and spend a fraction of the time doing it.',15,'https://picsum.photos/id/197/500/300'),(79,'It was a simple tip of the hat','Grace didn\'t think that anyone else besides her had even noticed it. It wasn\'t anything that the average person would notice, let alone remember at the end of the day.',31,'https://picsum.photos/id/198/500/300'),(80,'Cake or pie?','I can tell a lot about you by which one you pick. It may seem silly, but cake people and pie people are really different. I know which one I hope you are, but that\'s not for me to decide. So, what is it? Cake or pie?',50,'https://picsum.photos/id/199/500/300'),(81,'There was something in the tree.','There was something in the tree. It was difficult to tell from the ground, but Rachael could see movement. She squinted her eyes and peered in the direction of the movement, trying to decipher exactly what she had spied.',22,'https://picsum.photos/id/200/500/300'),(82,'Pink ponies and purple giraffes roamed the field.','Pink ponies and purple giraffes roamed the field. Cotton candy grew from the ground as a chocolate river meandered off to the side. What looked like stones in the pasture were actually rock candy. Everything in her dream seemed to be perfect except for the fact that she had no mouth.',10,'https://picsum.photos/id/201/500/300'),(83,'Are you getting my texts???','\"Are you getting my texts???\" she texted to him. He glanced at it and chuckled under his breath. Of course he was getting them, but if he wasn\'t getting them, how would he ever be able to answer? He put the phone down and continued on his project. He was ignoring her texts and he planned to continue to do so.',2,'https://picsum.photos/id/202/500/300'),(84,'He stepped away from the mic. This was the best take he had done so far','He stepped away from the mic. This was the best take he had done so far, but something seemed missing. Then it struck him all at once. Visuals ran in front of his eyes and music rang in his ears. His eager fingers went to work in an attempt to capture his thoughts hoping the results would produce something that was at least half their glory.',15,'https://picsum.photos/id/203/500/300'),(85,'The choice was red, green, or blue.','It didn\'t seem like an important choice when he was making it, but it was a choice nonetheless. Had he known the consequences at that time, he would likely have considered the choice a bit longer. In the end, he didn\'t and ended up choosing blue.',17,'https://picsum.photos/id/204/500/300'),(86,'He picked up the burnt end of the branch and made a mark on the stone.','Day 52 if the marks on the stone were accurate. He couldn\'t be sure. Day and nights had begun to blend together creating confusion, but he knew it was a long time. Much too long.',37,'https://picsum.photos/id/205/500/300'),(87,'The red glint of paint sparkled under the sun.','He had dreamed of owning this car since he was ten, and that dream had become a reality less than a year ago. It was his baby and he spent hours caring for it, pampering it, and fondling over it. She knew this all too well, and that\'s exactly why she had taken a sludge hammer to it.',27,'https://picsum.photos/id/206/500/300'),(88,'There were little things that she simply could not stand.','There were little things that she simply could not stand. The sound of someone tapping their nails on the table. A person chewing with their mouth open. Another human imposing themselves into her space. She couldn\'t stand any of these things, but none of them compared to the number one thing she couldn\'t stand which topped all of them combined.',18,'https://picsum.photos/id/207/500/300'),(89,'On Saturday nights I would sit by the phone','in the lobby, waiting for Naoko to call. Most of the others were out, so the lobby was usually deserted. I would stare at the grains of light suspended in that silent space, struggling to see into my own heart. What did I want? ',6,'https://picsum.photos/id/208/500/300'),(90,'Gentlemen of the free-and-easy sort','plume themselves on being acquainted with a move or two, and being usually equal to the time-of-day, express the wide range of their capacity for adventure by observing that they are good for anything from pitch-and-toss to manslaughter;',34,'https://picsum.photos/id/209/500/300'),(91,'In truth, Mrs. Gradgrind’s stock of facts in','general was woefully defective; but Mr. Gradgrind in raising her to her high matrimonial position, had been influenced by two reasons.  Firstly, she was most satisfactory as a question of figures; and, secondly,',20,'https://picsum.photos/id/210/500/300'),(92,'‘My dear Bounderby,’ Mr. Gradgrind began','‘Now, you’ll excuse me,’ said Bounderby, ‘but I don’t want to be too dear.  That, to start with.  When I begin to be dear to a man, I generally find that his intention is to come over me.',4,'https://picsum.photos/id/211/500/300'),(93,'He could find no answer, except life’s usual','answer to the most complex and insoluble questions. That answer is: live in the needs of the day, that is, find forgetfulness.',48,'https://picsum.photos/id/212/500/300'),(94,'Happiness was different in childhood.','so much then a matter simply of accumulation, of taking things – new experiences, new emotions – and applying them like so many polished tiles to what would someday be the marvellously finished pavilion of the self.',3,'https://picsum.photos/id/213/500/300'),(95,'So what is the answer? How can you stand','From the moment you go to prison you must put your cozy past firmly behind you. At the very threshold, you must say to yourself: “My life is over, a little early to be sure, but there’s nothing to be done about it. I shall never return to freedom.',1,'https://picsum.photos/id/214/500/300'),(96,'If only it were all so simple! If only there','were evil people somewhere insidiously committing evil deeds, and it were necessary only to separate them from the rest of us and destroy them. But the line dividing good and evil cuts through the heart of every human being. And who is willing to destroy a piece of his own heart?',13,'https://picsum.photos/id/215/500/300'),(97,'As for the leaflets reporting the creation of','the ROA, the “Russian Liberation Army,” not only were they written in bad Russian, but they were imbued with an alien spirit that was clearly German and, moreover, seemed little concerned with their presumed subject; besides, and on the other hand,',47,'https://picsum.photos/id/216/500/300'),(98,'And how can you bring it home to them?','an inspiration? By a vision? A dream? Brothers! People! Why has life been given you? In the deep, deaf stillness of midnight, the doors of the death cells are being swung open – and great-souled people are being dragged out to be shot.',37,'https://picsum.photos/id/217/500/300'),(99,'Like all men not really up to their job,','a stickler for externals and petty quotidian things; and in lieu of an intellect he had accumulated an armoury of capitalized key-words like Discipline and Tradition and Responsibility.',40,'https://picsum.photos/id/218/500/300'),(100,'But Art is a punitive sentence, not a','birthright, & there is nothing in my early life that suggests artistick aptitude or even interest, my pastimes & fascinations nearly all being what may – & were – deemed the merely villainous.',39,'https://picsum.photos/id/219/500/300'),(101,'All Hallows Day: grief comes in waves.','t threatens to capsize him. He doesn’t believe that the dead come back; but that doesn’t stop him from feeling the brush of their fingertips, wingtips, against his shoulder.',19,'https://picsum.photos/id/220/500/300'),(102,'Being in high school, Miles had no idea there','were girls in the world who might be nice to some boy who’d suffered the misfortune of falling in love with them, even when they couldn’t return the favor.',8,'https://picsum.photos/id/221/500/300'),(103,'But they didn’t devote the whole evening to','music. After a while they played at forfeits; for it is good to be children sometimes, and never better than at Christmas, when its mighty Founder was a child himself. Stop. There was first a game at blind-man’s buff.',25,'https://picsum.photos/id/222/500/300'),(104,'Each failed overture of peace made the next','overture less likely to succeed. Before long, what at first glance had seemed to Gary an absurd possiiblity – that the till of their marriage no longer contained sufficient funds of love and goodwill to cover the emotional costs that going to St.',46,'https://picsum.photos/id/223/500/300'),(105,'All men dream, but not equally.','dream by night in the dusty recesses of their minds wake in the day to find that it was vanity: but the dreamers of the day are dangerous men, for they may act their dreams with open eyes.',31,'https://picsum.photos/id/224/500/300'),(106,'Sometimes… Come on, how often exactly,','Bert? Can you recall four, five, more such occasions? Or would no human heart have survived two or three? Sometimes (I have nothing to say in reply to your question), while Lolita would be haphazardly preparing her homework,',23,'https://picsum.photos/id/225/500/300'),(107,'She would never know, because he would','never tell her. Somehow if she’d known the worst parts, she couldn’t have gone on being a haven for him. He was groping for an idea that he couldn’t quite grasp.',6,'https://picsum.photos/id/226/500/300'),(108,'He ran as he’d never run before','hope nor despair. He ran because the world was divided into opposites and his side had already been chosen for him, his only choice being whether or not to play his part with heart and courage.',24,'https://picsum.photos/id/227/500/300'),(109,'How vulgar, this hankering after','mmortality, how vain, how false. Composers are merely scribblers of cave paintings. One writes music because winter is eternal and because, if one didn’t, the wolves and blizzards would be at one’s throat all the sooner.',43,'https://picsum.photos/id/228/500/300'),(110,'The embassy’s door was of bulletproof steel','lined with a veneer of English oak. You attained it by touching a button in a silent lift. The royal crest, in this air-conditioned stillness, suggested silicone and funeral parlours.',27,'https://picsum.photos/id/229/500/300'),(111,'Act, implores the Ghost of Future Regret.','Jacob hurries past the tomatoes and catches her up near the gate.‘Miss Abigawa? Miss Aibagawa. I must ask you to forgive me.’She has turned around and has one hand on the gate. ‘Why forgive?',20,'https://picsum.photos/id/230/500/300'),(112,'The ship rolls and her timbers creak like','Men of commerce, sir…’ Nash counts out laudanum drops into the pewter beaker ‘… for the most part, had their consciences cut out at birth. Better an honest drowning than slow death by hypocrisy,',39,'https://picsum.photos/id/231/500/300'),(113,'He let the phone slip from his hand and lay','crying for a while, silently, shaking the cheap bed. He didn’t know what to do, he didn’t know how to live. Each new thing he encountered in life impelled him in a direction that fully convinced him of its rightness,',27,'https://picsum.photos/id/232/500/300'),(114,'When they leave the church, the last light is','vanishing into the sky, and a stray snowflake drifts along towards the south. They remount; it has been a long day; his clothes feel heavy on his back.',18,'https://picsum.photos/id/233/500/300'),(115,'In the days to follow the hacendado would','come up to the corral where they’d shaped the manada and he and John Grady would walk among the mares and John Grady would argue their points and the hacendado would muse and walk away a fixed distance.',9,'https://picsum.photos/id/234/500/300'),(116,'Imagine the silence now, in that place which','is no-place, that anteroom to God where each hour is ten thousand years long. Once you imagined the souls held in a great net, a web spun by God,',3,'https://picsum.photos/id/235/500/300'),(117,'Then, perhaps overcome with nostalgia for','happier times, he gave me a good kicking. Afterwards I assured him he had all the attributes necessary for a successful artistick career, through unfortunately my mouth was too swollen to list them for Pobjoy’s benefit: mediocrity;',46,'https://picsum.photos/id/236/500/300'),(118,'I knew that on the island one was driven','back into the past. There was so much space, so much silence, so few meetings that one too easily saw out of the present, and then the past seemed ten times closer than it was.',48,'https://picsum.photos/id/237/500/300'),(119,'It was but a hurried parting in a common','street, yet it was a sacred remembrance to these two common people.  Utilitarian economists, skeletons of schoolmasters, Commissioners of Fact,',24,'https://picsum.photos/id/238/500/300'),(120,'When a woman withdraws to give birth the','sun may be shining but the shutters of her room are closed so she can make her own weather. She is kept in the dark so she can dream. Her dreams drift her far away,',6,'https://picsum.photos/id/239/500/300'),(121,'Revolution and youth are closely allied.','can a revolution promise to adults? To some it brings disgrace, to others favor. But even that favor is questionable,',8,'https://picsum.photos/id/240/500/300'),(122,'The point was we took this shit very','seriously. They had taken away our flowers, our summer days, and our bonuses, we were on a wage freeze and a hiring freeze, and people were flying out the door like so many dismantled dummies.',47,'https://picsum.photos/id/241/500/300'),(123,'The old scholar was watching the noisy','young people around him and it suddenly occurred to him that he was the only one in the whole audience who had the privilege of freedom, ',45,'https://picsum.photos/id/242/500/300'),(124,'Later, on my walk, I wondered why I felt I','had to be suspicious of ‘normality’. The striking thing about the normal is that there is nothing normal about it:',19,'https://picsum.photos/id/243/500/300'),(125,'Looking back on those incidents,','always appalled by the memory of his passivity, hard though it was to see what else he could have done. He could have refused to pay for the gravy damage to his room, could have refused to change his shoes,',7,'https://picsum.photos/id/244/500/300'),(126,'I hoped she did not dislike me,','under no illusions that she might remember me in any way fondly; that is, if she remembered me at all. I was but one of a procession; I provided extra food, drink, that day some tobacco, beyond that I did not exist for her.',33,'https://picsum.photos/id/245/500/300'),(127,'If I may so ex­press it, I was steeped in Do­ra.','was not mere­ly over head and ears in love with her, but I was sat­urat­ed through and through. Enough love might have been wrung out of me, metaphor­ical­ly speak­ing,',49,'https://picsum.photos/id/246/500/300'),(128,'Lyrical poetry is a realm in which any','statement immediately becomes truth. Yesterday the poet said life is a vale of tears; today he said life is a land of smiles; and he was right both times. There is no inconsistency.',4,'https://picsum.photos/id/247/500/300'),(129,'Sometimes, when Chapuys has finished','digging up Walter’s bones and making his own life unfamiliar to him, he feels almost impelled to speak in defence of his father, his childhood. But it is no use to justify yourself. It is no good to explain. It is weak to be anecdotal.',40,'https://picsum.photos/id/248/500/300'),(130,'Always I had acted as if a third person was watching','Always I had acted as if a third person was watching and listening and giving me marks for good or bad behaviour – a god like a novelist, to whom I turned, like a character with the power to please, the sensitivity to feel slighted, the ability to adapt himself to whatever he believed the novelist-god wanted.',45,'https://picsum.photos/id/249/500/300'),(131,'What was I after all?','Near enough what Conchis had had me told: nothing but the net sum of countless wrong turnings. I dismissed most of the Freudian jargon of the trial; but all my life I had tried to turn life to fiction, to hold reality away.',35,'https://picsum.photos/id/250/500/300'),(132,'Now they were in the earth','Now they were in the earth to which they had given their lives; and slowly, year by year, the earth would take them.',46,'https://picsum.photos/id/251/500/300'),(133,'He thought of the cost exacted','He thought of the cost exacted, year after year, by the soil; and it remained as it had been—a little more barren, perhaps, a little more frugal of increase. Nothing had changed. Their lives had been expended in cheerless labor, their wills broken, their intelligences numbed.',8,'https://picsum.photos/id/252/500/300'),(134,'He buried her beside her husband','He buried her beside her husband. After the services were over and the few mourners had gone, he stood alone in a cold November wind and looked at the two graves, one open to its burden and the other mounded and covered by a thin fuzz of grass.',13,'https://picsum.photos/id/253/500/300'),(135,'I was disconcerted, for I had broken away','I was disconcerted, for I had broken away without quite seeing where I was going to. It was not to be shuffled off now, however, and I answered, `The beautiful young lady at Miss Havisham’s, and she’s more beautiful than anybody ever was, and I admire her dreadfully, and I want to be a gentleman on her account.’',38,'https://picsum.photos/id/254/500/300'),(136,'You must thrive in spite of yourself','You must thrive in spite of yourself; and so that you may do it, God takes out your heart of flesh, and gives you a heart of stone.',14,'https://picsum.photos/id/255/500/300'),(137,'He once thought it himself, that he might die','He once thought it himself, that he might die with grief: for his wife, his daughters, his sisters, his father and master the cardinal. But pulse, obdurate, keeps its rhythm. You think you cannot keep breathing, but your ribcage has other ideas, rising and falling, emitting sighs.˝',13,'https://picsum.photos/id/256/500/300'),(138,'On foot, from necessity or in deference','On foot, from necessity or in deference to his dismounted commander or associates, his conduct was the same. He would stand like a rock in the open when officers and men alike had taken to cover;',39,'https://picsum.photos/id/257/500/300'),(139,'He stood over the body in the fading light','Adjusting the hair and putting the finishing touches to the simple toilet, doing all mechanically, with soulless care. And still through his consciousness ran an undersense of conviction that all was right—that he should have her again as before, and everything explained.',50,'https://picsum.photos/id/258/500/300'),(140,'A secret always has a strengthening effect','A secret always has a strengthening effect upon a newborn friendship, as does the shared impression than an external figure is to blame: the men of the Crown have become united less by their shared beliefs, we observe, than by their shared misgivings.',46,'https://picsum.photos/id/259/500/300'),(141,'A judgment that is necessarily hampered','A judgment that is necessarily hampered, bot only by the scope and limits of his imagination, but by the ever-changing measure of his doubt and self-esteem.',3,'https://picsum.photos/id/260/500/300'),(142,'For although a man is judged by his actions','For although a man is judged by his actions, by what he has said and done, a man judges himself by what he is willing to do, by what he might have said, or might have done',48,'https://picsum.photos/id/261/500/300'),(143,'Everything failed to subdue me','Everything failed to subdue me. Soon everything seemed dull: another sunrise, the lives of heroes, failing love, war, the discoveries people made about each other.',9,'https://picsum.photos/id/262/500/300'),(144,'In the hospital men’s room','In the hospital men’s room, as I’m washing my hands, I glance in the mirror. The man I see is not so much me as my father. When did he show up? There is no soap; I rub hand sanitizer into my face–it burns. I nearly drown myself in the sink trying to rinse it off.',36,'https://picsum.photos/id/263/500/300'),(145,'But just as I didn’t want to resent my kids','I also didn’t want to find myself too much in love with them. There are parents who don’t like to hear their little girl crying at night, at the vast approaching dark of sleep, and so in their torment think why not feed her a lollipop, and a few years later that kid’s got seven cavities and a pulled tooth.',43,'https://picsum.photos/id/264/500/300'),(146,'Christ, he thinks, by my age I ought to know','You don’t get on by being original. You don’t get on by being bright. You don’t get on by being strong. You get on by being a subtle crook;',4,'https://picsum.photos/id/265/500/300'),(147,'They look so fine, and young','They look so fine, and young, and wrapped up in each other. Love is so fresh and clean at that age. Don’t you think?',4,'https://picsum.photos/id/266/500/300'),(148,'Your only chance of survival','Your only chance of survival, if you are sincerely smitten, lies in hiding this fact from the woman you love, of feigning a casual detachment under all circumstances.',41,'https://picsum.photos/id/267/500/300'),(149,'During the first part of your life','During the first part of your life, you only become aware of happiness once you have lost it. Then an age comes, a second one, in which you already know, at the moment when you begin to experience true happiness.',18,'https://picsum.photos/id/268/500/300'),(150,'Were you in love with her?','The question is in a way meaningless, she knows, but one must ask. Love in such situations is rarely real. Sex is the engine, exalting and ruining people, sex and frustration. Love is what people believe is worth the path of devastation.',15,'https://picsum.photos/id/269/500/300');
